import React, { useState } from "react";
import { motion } from "framer-motion";

import "./Header.scss";

export default function Header() {
  
  const placeholderText = [
    { type: "heading1", text: "Hi, I'm Andras" },
    {
      type: "heading2",
      text: "A software developer with financial background"
    }
  ];

  const container = {
    visible: {
      transition: {
        staggerChildren: 0.025
      }
    }
  };

  return (
      <motion.div
        className="App"
        initial="hidden"
        animate="visible"
        variants={container}
      >
        <div className="container">
          {placeholderText.map((item, index) => {
            return <AnimatedText {...item} key={index} />;
          })}
        </div>
      </motion.div>

  );
}
